import React from "react";
import { RouteComponentProps, useLocation } from "react-router";
import profilePic from "./images/profile/2602017071517530029820170521192154199Screenshot_2016-05-29-20-10-52_1.jpg";
import MoreVertIcon from "@material-ui/icons/MoreVert";
import SuperstarzIconLight from "./images/s.png";

interface stateType {
  userdata: { username: string; usercolor: string; userimage: string };
}

function Supercheck() {
  const { state } = useLocation<stateType>();
  console.log(state.userdata);
  return (
    <div style={{ height: "100vh", width: "100%" }}>
      <div
        className="center-content-vertically"
        style={{
          zIndex: 1,
          width: "100%",
          backgroundColor: "#00ccff",
          display: "grid",
          position: "absolute",
          height: "0px",
        }}
      >
        <div
          style={{
            position: "relative",
            margin: "auto",
            left: "-11.5%",
            top: "-26vh",
            backgroundColor: "green",
            height: "80px",
            width: "80px",
            borderRadius: "50%",
            textAlign: "center",
            alignItems: "center",
            display: "grid",
            justifyContent: "center",
          }}
        >
          {" "}
          <MoreVertIcon style={{ fontSize: "3.8rem" }} />
        </div>
      </div>
      <div
        className="center-content-vertically"
        style={{
          cursor: "pointer",
          zIndex: 0,
          width: "100%",
          display: "grid",
          position: "absolute",
        }}
      >
        <img
          style={{
            position: "relative",
            objectFit: "contain",
            width: "30%",
            borderRadius: "200px",
            margin: "auto",
          }}
          src={profilePic}
          alt="SuperstarZ logo"
        />
      </div>

      <div
        className="text-superstarz-light"
        style={{
          width: "100%",
          padding: "20px",
          backgroundColor: "#00ccff",
          position: "fixed",
          top: "0em",
          fontFamily: "kaushan_scriptregular",
          fontSize: "2.41vw",
          fontWeight: "bolder",
          transition: "opacity 1.5s",
          textAlign: "left",
        }}
      >
        <img
          style={{
            position: "relative",
            objectFit: "contain",
            width: "6%",

            margin: "auto",
          }}
          src={SuperstarzIconLight}
          alt="SuperstarZ logo"
        />
        SuperstarZ
      </div>
    </div>
  );
}

export default Supercheck;
